                <td> <p class="notencab-e2"> &#8220;Con un esp&iacute;ritu democr&aacute;tico y transparente, rendir Cuenta P&uacute;blica ante la ciudadan&iacute;a, es establecer un contacto directo con la comunidad y el gobierno, af&iacute;n de dar a conocer las acciones que se est&aacute;n desarrollando, junto con conocer las inquietudes de la ciudadan&iacute;a&#8221;.</p>
                  </td></tr>
			 <tr><td>
			 <p align="center"><img src="../imagenes/gabprovlimari.jpg" alt="" title=" Gabinete Gobernaci&oacute;n Provincial de Limar&iacute;  " width="450" height="338" hspace="5" vspace="5" style="padding:4px;border:1px solid #ddd;"/></p>
			 <p class="noticia-e2" align="justify"><strong>Orgullosos pero no satisfechos.</strong><br />
Este año, estamos orgullosos del gran apoyo ciudadano a nuestro Presidente Lagos con un 76% de apoyo en la encuesta IPSOS.  Estamos orgullosos del 5º lugar obtenido en el índice de competitividad regional, que constituye una nueva realidad. Estamos orgullosos, que el desempleo calculado por el INE haya llegado a una cifra histórica de 2,6% en verano. Estamos orgullosos, por el aprecio, respeto y cariño que nos brindan día a día cuando estamos cara a cara con ustedes. Estamos orgullosos con la disminución de la pobreza rural en casi 10 puntos porcentuales y cerca de 4 puntos en el área urbana.			 </p>
		      <p class="noticia-e2" align="justify"><strong>Pero nunca vamos a estar satisfechos</strong> mientras exista injusticia social manifestada en la pobreza, el desempleo que rasguña los 2 dígitos, se mantenga la concentración de la riqueza, o si existe dolor o pena ante situaciones de abandono.</p>
			      
			  </td></tr>
