			 <tr>
                <td> <p class="noticia-e2" align="justify"> <strong>INTEGRACION: SELLO DE LA CUENTA PÚBLICA.</strong><br />
El sello de esta cuenta pública es la Integración.  Así definida porque creemos que promueve un “estilo positivo” que se centra en las personas y la familia como base de la intervención de gobierno. </p>

<p class="noticia-e2" align="justify">Por esta razón, esta fiesta ciudadana tiene al centro a niños con problemas de aprendizaje y niños víctimas de abusos. Una franja más sensible que los problemas más gruesos como son el empleo, la delincuencia, la oportunidad y calidad de la prestación de salud, o la calidad de la educación. </p>

<p class="noticia-e2" align="justify">Queremos que nos vean como UN GOBIERNO PROVINCIAL QUE ABRE SUS BRAZOS, ESCUCHA Y RESPONDE. Que se integra a si mismo, y hoy rinde cuenta con los miembros de este equipo.</p>

				
			  </td></tr>
			  <tr><td height="25"></td></tr>
			 <tr>
                <td> <p class="noticia-e2" align="justify"> <strong>SOMOS UN GRAN EQUIPO.</strong><br>
                    Los resultados de nuestra gestión de gobierno, son logro de nuestra coalición de gobierno de la CONCERTACION DE PARTIDOS POR LA DEMOCRACIA.</p>

<p class="noticia-e2" align="justify">Nos unimos todo el ejecutivo del Presidente Lagos, nuestro senador Jorge Pizarro, nuestros diputados Patricio Walker y Francisco Encina, nuestra Diputada Adriana Muñoz que juntos a través de consensos aprueban la Ley de Presupuesto de la nación donde se define qué, cuando y donde invertir. Mientras que en nuestra región es nuestro Intendente, Gabinete Regional, Consejeros Regionales, Alcaldes, Concejales y Comunidad, quienes constituimos un equipo para enfrentar nuestras necesidades.</p>
</p>
